import * as React from "react";
import { default as styled } from "styled-components";
import { connect, DispatchProp } from "react-redux";
import { IApplicationState } from "../redux/redux-types";
import { mouseModuleStateChange } from "./house-actions";
import { IHouseModule, IHouseProps } from "./house-types";

interface IItemStyledProps {
  left?: number;
  top?: number;
  active: boolean;
}
const planSrc =
  "data:image/jpeg;base64,";
const Plan = styled.img`
  position: absolute;
  width: 200px;
  height: 200px;
  left: 200px;
  top: 120px;
`;
const Slot = styled<IItemStyledProps, "div">("div")`
  cursor: pointer;
  height: 50px;
  width: 50px;
  border: 1px solid black;
  position: ${p => (p.active ? "static" : "relative")};
`;
const ImageItem = styled<IItemStyledProps, "img">("img")`
  cursor: pointer;
  transition-property: all;
  transition-duration: 2s;
  position: relative;
  left: ${p => (p.active ? p.left + "px" : 0)};
  top: ${p => (p.active ? p.top + "px" : 0)};
  height: ${p => (p.active ? "50px" : "20px")};
  font-size: ${p => (p.active ? "50px" : "20px")};
  border: 1px solid black;
  &:hover {
    color: grey;
  }
`;

const HouseComponent = (props: IHouseProps & DispatchProp<void>) => {
  const { dispatch } = props;
  const ModuleItem = (item: IHouseModule) => {
    const onClick = () => dispatch(mouseModuleStateChange(item.id));

    return (
      <Slot key={item.id} active={item.active} onClick={onClick}>
        {item.name}
        <ImageItem
          src={item.src}
          active={item.active}
          left={item.coordinates[0]}
          top={item.coordinates[1]}
        />
      </Slot>
    );
  };

  const cost = props.house.reduce(
    (previousValue: number, item: IHouseModule) =>
      item.active ? previousValue + item.cost : previousValue,
    0
  );

  return (
    <React.Fragment>
      {cost + "₽"}
      <Plan key={"plan"} src={planSrc} />
      <ul>{props.house.map(item => ModuleItem(item))}</ul>
    </React.Fragment>
  );
};

const selector = (state: IApplicationState): IHouseProps => ({
  house: state.house
});

export const House = connect(selector)(HouseComponent);
